public var lookAtHead : LookAt;
public var lookAtLEye : LookAt;
public var lookAtREye : LookAt;
public var Animator : Animator;
public var animations : Animation[];

LS.Globals._animation = "idle";
this._animation_options = ["idle", "repeat","show","thanks","talking","talking2","talking_hiaro","wave","wave_hiaro", "talking0", "talking_hiaro0"];
var _a_index = 0;

this.onStart = function()
{
    A = this.Animator;

    if ( !A )
        throw ( "BehaviorScript: no animator attached" );
  	if( this.animations.length === 0 )
      return;

    A.cleanUp();

  	A.addParameter(LS.Globals, "_animation", "idle");

   	var l1 = A.addLayer({name:"states"});

  	var that = this;
  	var enableHeadLookAt = function(state){
      that.lookAtLEye.enabled = true; 
      that.lookAtREye.enabled = true;
      that.lookAtHead.enabled = true;
    };
  	var disableHeadLookAt = function(state){
      that.lookAtLEye.enabled = false;
      that.lookAtREye.enabled = false;
			that.lookAtHead.enabled = false;
    };

		var idle 					= A.addState(l1, {name:"idle", 					callback: function(state){_a_index = 0; LS.Globals._animation="idle"}});
  	var repeat 				= A.addState(l1, {name:"repeat", 				callback: function(state){_a_index = 1; }});
  	var show 					= A.addState(l1, {name:"show",					callback: function(state){_a_index = 2; }});
  	var thanks				= A.addState(l1, {name:"thanks", 				callback: function(state){_a_index = 3; }});
  	var talking 			= A.addState(l1, {name:"talking",				callback: function(state){_a_index = 4; }});
  	var talking2			= A.addState(l1, {name:"talking2",			callback: function(state){_a_index = 5; }});
  	var talking_hiaro	= A.addState(l1, {name:"talking_hiaro",	callback: function(state){_a_index = 6; }});
  	var wave 					= A.addState(l1, {name:"wave",					callback: function(state){_a_index = 7; }});
		var wave_hiaro 		= A.addState(l1, {name:"wave_hiaro",		callback: function(state){_a_index = 8; }});
		var talking0 				= A.addState(l1, {name:"talking0",				callback: function(state){_a_index = 9; }});
  	var talking_hiaro0	= A.addState(l1, {name:"talking_hiaro0",	callback: function(state){_a_index = 10; }});


    A.addMotionFromURL(idle, 					this.animations[00], "default", Animator.LOOP, 0.25);
    A.addMotionFromURL(repeat, 				this.animations[01], "default", Animator.ONCE, 0.5);
    A.addMotionFromURL(show, 					this.animations[02], "default", Animator.ONCE, 0.5);
    A.addMotionFromURL(thanks, 				this.animations[03], "default", Animator.ONCE, 0.5);
  	A.addMotionFromURL(talking, 			this.animations[04], "default", Animator.ONCE, 0.5);
    A.addMotionFromURL(talking2, 			this.animations[05], "default", Animator.ONCE, 0.5);
 		A.addMotionFromURL(talking_hiaro,this.animations[06], "default", Animator.ONCE, 0.5);
    A.addMotionFromURL(wave, 					this.animations[07], "default", Animator.ONCE, 0.5);
		A.addMotionFromURL(wave_hiaro, 		this.animations[08], "default", Animator.ONCE, 0.5);

  	A.addMotionFromURL(talking0, 			this.animations[04], "default0", Animator.ONCE, 0.5);
		A.addMotionFromURL(talking_hiaro0,this.animations[06], "default0", Animator.ONCE, 0.5);



  	A.setDefaultState(l1, idle);

    A.addTransition(idle,  				repeat, 				"_animation", Animator.EQUALS, "repeat");
    A.addTransition(idle,  				show, 					"_animation", Animator.EQUALS, "show");
    A.addTransition(idle,  				thanks, 				"_animation", Animator.EQUALS, "thanks");
  	A.addTransition(idle,  				talking, 				"_animation", Animator.EQUALS, "talking");
    A.addTransition(idle,  				talking2, 			"_animation", Animator.EQUALS, "talking2");
    A.addTransition(idle,  				talking_hiaro,	"_animation", Animator.EQUALS, "talking_hiaro");
    A.addTransition(idle,  				wave, 					"_animation", Animator.EQUALS, "wave");
    A.addTransition(idle,  				wave_hiaro, 		"_animation", Animator.EQUALS, "wave_hiaro");
		A.addTransition(idle,  				talking0, 			"_animation", Animator.EQUALS, "talking0");
  	A.addTransition(idle,  				talking_hiaro0,	"_animation", Animator.EQUALS, "talking_hiaro0");



  	A.addTransition(repeat,  			idle, "localtime", Animator.GREATER, 0.95);
  	A.addTransition(show,  				idle, "localtime", Animator.GREATER, 0.95);
    A.addTransition(thanks,  			idle, "localtime", Animator.GREATER, 0.95);
  	A.addTransition(talking,  		idle, "localtime", Animator.GREATER, 0.95);
  	A.addTransition(talking2, 		idle, "localtime", Animator.GREATER, 0.95);
		A.addTransition(talking_hiaro,idle, "localtime", Animator.GREATER, 0.95);
  	A.addTransition(wave,  				idle, "localtime", Animator.GREATER, 0.95);
		A.addTransition(wave_hiaro, 	idle, "localtime", Animator.GREATER, 0.95);
  	A.addTransition(talking0,  		idle, "localtime", Animator.GREATER, 0.95);
		A.addTransition(talking_hiaro0,idle, "localtime", Animator.GREATER, 0.95);

  	A.addTransition(repeat,  			idle, "_animation", Animator.ISNOT, "repeat");
  	A.addTransition(show,  				idle, "_animation", Animator.ISNOT, "show");
    A.addTransition(thanks,  			idle, "_animation", Animator.ISNOT, "thanks");
  	A.addTransition(talking,  		idle, "_animation", Animator.ISNOT, "talking");
  	A.addTransition(talking2, 		idle, "_animation", Animator.ISNOT, "talking2");
		A.addTransition(talking_hiaro,idle, "_animation", Animator.ISNOT, "talking_hiaro");
  	A.addTransition(wave,  				idle, "_animation", Animator.ISNOT, "wave");
		A.addTransition(wave_hiaro, 	idle, "_animation", Animator.ISNOT, "wave_hiaro");
  	A.addTransition(talking0,  		idle, "_animation", Animator.ISNOT, "talking0");
		A.addTransition(talking_hiaro0,idle, "_animation", Animator.ISNOT, "talking_hiaro0");

    A.onStart();
  console.log(A);
}
this.onRenderGUI = function(ctx)
{ 
  if(!LS.Globals.showGUI)
    return;
  //LS.GUI.Label( [40,40,400,42], "Kristina Animation Test");



  LS.GUI.Box(   [0,0,300,24], "#333333" );
  LS.GUI.Box(   [160,0,140,24], "#DB5461" );
  LS.GUI.Label( [0,0,400,24], "Current Animation: " +LS.Globals._animation);
  _a_index = LS.GUI.Toolbar( [250,0,1920 - 301,24], _a_index, this._animation_options );
  LS.Globals._animation = this._animation_options[_a_index];


}
